import React from 'react';

import {Props} from './types';

import './cell.css';

const cn = 'cell';

const CellComponent: Props = ({cell, isSelected}) => {
    return (
        <div className={[cn, cell.color, isSelected ? 'selected' : ''].join(' ')}>
            <div className={`${cn}-available`}/>
            {cell.currentFigure && cell.currentFigure.logo &&
                <img
                    className="figure"
                    src={cell.currentFigure.logo} 
                    alt="figure"
                />
            }
        </div>
    );
}

export default CellComponent;
